    useEffect(() => {
      const fetchAllUsers = async ()=>{
        try{
            const res = await axios.get("http://localhost:8802/users");
            setUsers(res.data)
        }catch(err){
            console.log(err)
        }
      }
      fetchAllUsers()
    }, [])
    

  return (
    bruh
    
  )
}

export default Users;
